    let { id } = useParams();
    useEffect(() => {
        console.log('id is ', id)
        axios.get(`http://localhost:3001/post/byId/${id}`).then((response) => {
        console.log('response is ', response)
        })
    });
    return (
        <div>
            we made it {id}
        </div>
    )
}

